import React from 'react';
import { Transition } from '@headlessui/react';

function Slider() {
  const [currentSection, setCurrentSection] = React.useState('Inicio');

  const navegacion = (seccion) => {
    setCurrentSection(seccion);
    const element = document.getElementById(seccion);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="relative">
      <nav className="fixed top-0 left-0 right-0 flex justify-center items-center py-4 z-50 ">
        <div className="flex justify-center items-center rounded-full shadow-md bg-white">
          <button
            onClick={() => navegacion('Inicio')}
            
          >
            Inicio
          </button>
          <button
            onClick={() => navegacion('Tecnologias')}
            className={`py-2 px-4 focus:outline-none rounded-full ml-4 ${
              currentSection === 'Tecnologias' ? 'bg-gray-200 text-gray-800' : 'hover:bg-gray-200 hover:text-gray-800'
            }`}
          >
            TecnologÃ­as
          </button>
          <button
            onClick={() => navegacion('ExperienciayFormacion')}
            className={`py-2 px-4 focus:outline-none rounded-full ml-4 ${
              currentSection === 'ExperienciayFormacion' ? 'bg-gray-200 text-gray-800' : 'hover:bg-gray-200 hover:text-gray-800'
            }`}
          >
            Experiencia y FormaciÃ³n
          </button>
          <button
            onClick={() => navegacion('Proyectos')}
            className={`py-2 px-4 focus:outline-none rounded-full ml-4 ${
              currentSection === 'Proyectos' ? 'bg-gray-200 text-gray-800' : 'hover:bg-gray-200 hover:text-gray-800'
            }`}
          >
            Proyectos
          </button>
        </div>
      </nav>

      <Transition
        show={currentSection === 'Inicio'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform -translate-x-full"
        enterTo="opacity-100 transform translate-x-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-x-0"
        leaveTo="opacity-0 transform -translate-x-full"
      >
        <div id="Inicio" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-green-200 to-blue-200">
          <h2 className="text-4xl font-bold">Inicio</h2>
          <p className="mt-2">Scroll Down for next slide</p>
        </div>
      </Transition>

      <Transition
        show={currentSection === 'Tecnologias'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform translate-x-full"
        enterTo="opacity-100 transform translate-x-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-x-0"
        leaveTo="opacity-0 transform translate-x-full"
      >
        <div id="Tecnologias" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-indigo-800 to-purple-800 text-white">
          <h2 className="text-4xl font-bold">TecnologÃ­as</h2>
          <p className="mt-2">Scroll Down for next slide</p>
        </div>
      </Transition>

      <Transition
        show={currentSection === 'ExperienciayFormacion'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform -translate-y-full"
        enterTo="opacity-100 transform translate-y-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-y-0"
        leaveTo="opacity-0 transform -translate-y-full"
      >
        <div id="ExperienciayFormacion" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-purple-800 to-pink-800 text-white">
          <h2 className="text-4xl font-bold">Experiencia y FormaciÃ³n</h2>
          <p className="mt-2">Scroll Down</p>
        </div>
      </Transition>

      <Transition
        show={currentSection === 'Proyectos'}
        enter="transition ease-out duration-500"
        enterFrom="opacity-0 transform translate-y-full"
        enterTo="opacity-100 transform translate-y-0"
        leave="transition ease-in duration-300"
        leaveFrom="opacity-100 transform translate-y-0"
        leaveTo="opacity-0 transform translate-y-full"
      >
        <div id="Proyectos" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-blue-200 to-indigo-100 text-black">
          <h2 className="text-4xl font-bold">Proyectos</h2>
        </div>
      </Transition>
    </div>
  );
}

export default Slider;
